import React from "react";

const QuizName = ({ quiz }) => {
  const { name, logo, id, total } = quiz;
  return (
    <div className="border border-2">
      <h2>display quiz name. {name}</h2>
      <p>Total Que: {total}</p>
      <img src={logo} alt="" />
    </div>
  );
};

export default QuizName;
